        <>
            <h3 className="headdiv">ADD DIVISIONS</h3>
            <div className="container addtodiv">
                <form className="container formaddtodiv col-3">
                    <div className="mb-3">
                        <label for="NumberofDivisions" className="form-label">Email address</label>
                        <input type="number" className="form-control" id="NumberofDivisions"  />
                        
                    </div>
                    <button type="submit" className="btn btn-primary">Submit</button>
                </form>
            </div>
        </>
    )
}
